import React, { useState, useEffect } from "react";
import { Link } from "react-router-dom";
import { getManyByTitle } from "../hooks/hooks";
import { Movie } from "./Movie";

export const Movies = () => {
  const [movies, setMovies] = useState([]);

  useEffect(() => {
    getManyByTitle("Batman").then((movies) => setMovies(movies));
  }, []);

  return (
    <>
      <input type="text" />
      {movies &&
        movies.map((movie) => {
          return (
            <section key={movie.imdbID}>
              <Link to="/movie/name">
                <h1>{movie.Title}</h1>
                <img src={movie && movie.Poster} />
                <h3>{movie.Year}</h3>
              </Link>
            </section>
          );
        })}
    </>
  );
};
